import { NEW_TYPES } from "../types/newTypes";

const newsReducer = (state = [], action) => {
  switch (action.type) {
    case NEW_TYPES.GET_NOTIFIES:
      return action.payload;
    default:
      return state;
  }
};

export default newsReducer;
